                <div className={`reset-options-container nav-top-${showNav ? 'active' : 'inactive'}`}>

                </div>
                <div className="-bar-container">
                    <div className={`previous-animation-container nav-top-${showNav ? 'active' : 'inactive'}`}>

                    </div>
                    <div>

                    </div>
                </div>
                <div className={`speed-options-container nav-top-${showNav ? 'active' : 'inactive'}`}>

                </div>
            </div>
        )
    }
}
